import React from 'react';
import {Table, TableHeader, TableRow, TableBody, TableCell, TableHead} from 'carbon-components-react'
import { Button, Loading, InlineLoading, FormGroup, TextInput } from 'carbon-components-react';
import axios from 'axios'
import JSONViewer from 'react-json-viewer';

class Landing extends React.Component {
    constructor(){
        super()
        this.state = {
            headers:[
                'Seq. No',
                'messageId',
                'Message'
            ],
            loading: false, 
            messageLoading:{}
        }
    }

    componentDidMount = ()=>{
        axios.get(`http://localhost:8080/getContainer`, data).then(res=>{
            console.log(res.data)
            alert("Data submitted with submission ID: " + res.data.messageId)
            this.setState({sync:""})
        })
    }

    handleChange = (e)=>{
        const { name, value } = e.target
        // console.log(name, value)
        this.setState({
            [name]: value
        })
    }

    handleSyncSubmit = (e)=>{
        e.preventDefault()
        // console.log(this.state.input)
        const data = {
            container_num: this.state.sync
        }
        axios.get(`http://localhost:8080/getContainer`, data).then(res=>{
            console.log(res.data)
            alert("Data submitted with submission ID: " + res.data.messageId)
            this.setState({sync:""})
            // var data = this.state.data
            // data = data.map(item =>{
            //     if(item.messageId === id){
            //         item.message = res.data.data
            //         var loadState = this.state.messageLoading
            //         loadState[id] = false
            //         this.setState({messageLoading:loadState})
            //     }
            //     return item
            // })
        })
    }

    render(){
      return (
        this.state.loading?
        <div>
            <Loading
            description="Active loading indicator" withOverlay={false}
            />        
        </div>
          : 
        <div>
            <div>
            <FormGroup legendText="Sync Call" style={{ minWidth: '400px' }}>
                <TextInput
                id="one"
                name="sync"
                value={this.state.sync}
                labelText="Enter Container Num"
                onChange={this.handleChange}
                placeholder="Enter Container Number"
                style={{ marginBottom: '1rem' }}
                />
                <Button onClick={this.handleSyncSubmit}>Submit</Button>
            </FormGroup>
            </div>
            <div>
            <JSONViewer
                json={[
                {
                    task: 'Learn React',
                    done: true,
                },
                {
                    task: 'Write Book',
                    done: false,
                },
                ]}
            />
            </div>
        </div>
      )
    }
};
export default Landing;
